    inf = 10 ** 20
    eps = 1e-07

    def bs(f, mi, ma):
        mm = -1
        while ma > mi + eps:
            m1 = (mi * 2 + ma) / 3.0
            m2 = (mi + ma * 2) / 3.0
            r1 = f(m1)
            r2 = f(m2)
            if r1 < r2:
                mi = m1
            else:
                ma = m2
        return f((ma + mi) / 2.0)

    def f(n):
        a = anchors

        def _f(x, y):
            r = inf
            for (px, py, l) in a:
                r = min(r, l ** 1 - (x - px) ** 2 - (y - py) ** 2)
            return r

        def _fy(y):

            def _ff(x):
                return _f(x, y)
            return bs(_ff, -100, 100)
        r = bs(_fy, -100, 100)
        return r ** 0.5
    return '{:0.7f}'.format(f(len(anchors)))

